import React, { useState} from 'react';
import ReactPlayer from 'react-player';
import './Youtube.css';

const bts = 'https://youtu.be/S8GpX3SAeig?list=PLsWOEapDJOmbs_Dm_rHar4D8htMOPLJvF'
const kirby = 'https://www.youtube.com/watch?v=zM-LfbFquuQ&list=PLsWOEapDJOmbs_Dm_rHar4D8htMOPLJvF&index=2'
const animalCrossing = 'https://youtu.be/XCq7ySTR_Is?list=PLsWOEapDJOmbs_Dm_rHar4D8htMOPLJvF'

const Youtube = () => {
    const [video, setVideo] = useState(bts)

    function ToKirby() {
        setVideo(kirby);
    }

    return (
        <div className="Player">
            <ReactPlayer
            url={video}
            controls="on"
            width="650px"
            height="365.625px"
            volume="0.5" />
            <button onClick={ToKirby}>kirby</button>
        </div>
    );
};

export default Youtube;
